import React from "react";

export default function Footer() {
  return (
    <section className="footer">
      <img className="img1" />
      <img className="img2" />
      <img className="img3" />
      <p>Life lessons with Katie Zaferes</p>
      <p>From $136 / person</p>
    </section>
  );
}
